import React from 'react';
import Content from './Content';
import Hero from "../../components/Hero/Hero";
import CarouselHome from "../Carousel/CarouselHome";
import {Footer} from "../Footer/Footer";




const Home = () => {
    return (
        <div>

            <Hero>
                <Content/>
            </Hero>
            <CarouselHome/>
            <Footer/>


        </div>
    );
};

export default Home;
